	float const PI = 3.1415926535897932384626433832795f;
		
	int clamp( int a, int lo, int hi )
		{
		return a < lo ? lo : a > hi ? hi : a;
		}

		
	int max( int a, int b )
		{
		return a > b ? a : b;
		}

	#pragma warning( push )
	#pragma warning( disable: 4458 )
		
	void glyph( pixelfont_t const* font, char ascii, int x, int y, APP_U8 color, APP_U8* out, int width, int height )
		{
		APP_U8 const* g = font->glyphs + font->offsets[ (APP_U8) ascii ];
		++g;
		int w = *g++;
		int h = font->height;
		for( int iy = y; iy < y + h; ++iy )
			{
			for( int ix = x; ix < x + w; ++ix )
				{
				if( *g++ && ix >= 0 && iy >= 0 && ix < width && iy < height && out[ iy * width + ix ] < color ) out[ iy * width + ix ] = color;
				}
			}
		}

		
	int glyph_width( pixelfont_t const* font, char ascii )
		{
		APP_U8 const* g = font->glyphs + font->offsets[ (APP_U8) ascii ];
		return g[ 1 ];
		}

			
	void text( pixelfont_t const* font, char const* str, int x, int y, APP_U8 color, int vspace, APP_U8* out, int width, int height )
		{
		int xp = x;
		int max_x = x;
		while( *str )
			{		
			APP_U8 const* g = font->glyphs + font->offsets[ (APP_U8) *str ];
			x += (char) *g++;
			int w = *g++;
			int h = font->height;
			for( int iy = y; iy < y + h; ++iy )
				{
				for( int ix = x; ix < x + w; ++ix )
					{
					if( *g++ && ix >= 0 && iy >= 0 && ix < width && iy < height && out ) out[ iy * width + ix ] = color;
					}
				}
			x += (char) *g++;
			bool linebreak = *str == '\n';
			++str;

			int kern = *g++;
			for( int k = 0; k < kern; ++k )
				if( *g++ == *str ) { x += (char) *g++; break; } else ++g;
			
			if( linebreak || *str =='\0' ) { max_x = x > max_x ? x : max_x; x = xp; y += font->line_spacing + vspace;  }
			}
		}	
		
			
	void line( int x1, int y1, int x2, int y2, APP_U8 c, int w, int h, APP_U8* p )
		{
		int dx = abs( x2 - x1 ); int sx = x1 < x2 ? 1 : -1; 
		int dy = abs( y2 - y1 ); int sy = y1 < y2 ? 1 : -1; 
		int err = ( dx > dy ? dx : -dy ) / 2; int x = x1; int y = y1;
		while( x != x2 || y != y2 )
			{
			if( x >= 0 && x < w && y >= 0 && y < h && p[ x + y * w ] < c ) p[ x + y * w ] = c;		
			int e2 = err; if( e2 > -dx ) { err -= dy; x += sx; } if( e2 < dy ) { err += dx; y += sy; }
			}
		}

		
	void line_add( int x1, int y1, int x2, int y2, APP_U8 c, int w, int h, APP_U8* p )
		{
		int dx = abs( x2 - x1 ); int sx = x1 < x2 ? 1 : -1; 
		int dy = abs( y2 - y1 ); int sy = y1 < y2 ? 1 : -1; 
		int err = ( dx > dy ? dx : -dy ) / 2; int x = x1; int y = y1;
		while( x != x2 || y != y2 )
			{
			if( x >= 0 && x < w && y >= 0 && y < h ) p[ x + y * w ] = (APP_U8)clamp( p[ x + y * w ] + c, 0, 255 );		
			int e2 = err; if( e2 > -dx ) { err -= dy; x += sx; } if( e2 < dy ) { err += dx; y += sy; }
			}
		}
		
		
	APP_U8 const grid_density = 16;

	void render_grid( float xp, float yp, int r, float* offsets, int w, int h, APP_U8* p )
		{
		xp = (float)( (int)( xp / grid_density ) ) * grid_density + grid_density / 2;
		yp = (float)( (int)( yp / grid_density ) ) * grid_density + grid_density / 2;
		APP_U8 c = 32;

		// for( int x = 8; x < w; x += grid_density ) line_add( x, 0, x, h, c, w, h, p );
		// for( int y = 8; y < h; y += grid_density ) line_add( 0, y, w, y, c, w, h, p );
		int wc = w / grid_density + 2;
		int hc = h / grid_density + 2;
		
		for( int i = 0; i < 2 * wc * hc; ++i ) offsets[ i ] *= 0.90f;
		
		for( int y = 0; y < hc; ++y )
			{
			for( int x = 0; x < wc; ++x )
				{
				int x1 = (int)( -grid_density / 2 + x * grid_density );
				int y1 = (int)( -grid_density / 2 + y * grid_density );
				float dx = xp - x1; 
				float dy = yp - y1;
				float len = sqrtf( dx * dx + dy * dy );
				if( len < r * 2.0f && len > grid_density * 0.5f )
					{
					len /= r * 2.0f;
					len = len * len;
					float v0 = offsets[ 2 * ( x + y * wc ) + 0 ];
					float v1 = offsets[ 2 * ( x + y * wc ) + 1 ];
					v0 += ( dx / ( len * r * 2.0f ) ) * 0.3f;
					v1 += ( dy / ( len * r * 2.0f ) ) * 0.3f;
					float limit = grid_density * 0.75f;
					offsets[ 2 * ( x + y * wc ) + 0 ] = v0 > limit ? limit : v0 < -limit ? -limit : v0;
					offsets[ 2 * ( x + y * wc ) + 1 ] = v1 > limit ? limit : v1 < -limit ? -limit : v1;
					}
				}
			}
		
		for( int y = 0; y < hc - 1; ++y )
			{
			for( int x = 0; x < wc - 1; ++x )
				{
				float x1ofs = offsets[ 2 * ( x + y * wc ) + 0 ];
				float y1ofs = offsets[ 2 * ( x + y * wc ) + 1 ];			
				float x2ofs = offsets[ 2 * ( x + 1 + y * wc ) + 0 ];
				float y2ofs = offsets[ 2 * ( x + 1 + y * wc ) + 1 ];			
				float x3ofs = offsets[ 2 * ( x + ( y + 1 ) * wc ) + 0 ];
				float y3ofs = offsets[ 2 * ( x + ( y + 1 ) * wc ) + 1 ];			
				int x1 = (int)( -grid_density / 2 + x * grid_density + x1ofs );
				int y1 = (int)( -grid_density / 2 + y * grid_density + y1ofs );
				int x2 = (int)( -grid_density / 2 + ( x + 1 ) * grid_density + x2ofs );
				int y2 = (int)( -grid_density / 2 + ( y ) * grid_density + y2ofs );
				int x3 = (int)( -grid_density / 2 + x * grid_density + x3ofs );
				int y3 = (int)( -grid_density / 2 + ( y + 1 ) * grid_density + y3ofs );
				line_add( x1, y1, x2, y2, c, w, h, p );
				line_add( x1, y1, x3, y3, c, w, h, p );
				}
			}
		}


	void render_matrix( matrix_data_t* data, pixelfont_t const* font, int w, int h, APP_U8* p )
		{
		for( int c = 0; c < data->column_count; ++c )
			{
			if( data->columns[ c ].speed == 0.0f )
				{
				if( data->columns[ c ].countdown > 0.0f ) 
					{
					data->columns[ c ].countdown -= 0.01f;	
					}
				else
					{
					data->columns[ c ].speed = randf();
					data->columns[ c ].position = (float) -( data->row_count )* ( font->height - 2 );
					for( int j = 0; j < data->row_count; ++j ) data->columns[ c ].ascii[ j ] = (char) rand( ' ', 'z' );
					}
				}
			}
			
		int limit = - ( font->height - 2 ) * ( data->row_count - 1 - h / ( font->height - 2 ) ) ;
		for( int c = 0; c < data->column_count; ++c )
			{
			matrix_data_t::matrix_column_t* column = &data->columns[ c ];
			if( column->speed != 0.0f )
				{				
				column->position = column->position + ( 2 + 3 * column->speed ) * 0.4f;	
				if( column->position > 20 )
					{
					memset( column, 0, sizeof( *column ) );
					column->countdown = randf() + 0.5f;
					continue;
					}
				}
			}
		
		
		int xofs = 0;
		int yofs = 0;
		for( int c = 0; c < data->column_count; ++c )
			{
			matrix_data_t::matrix_column_t* column = &data->columns[ c ];
			for( int r = 0; r < data->row_count; ++r )
				{
				if( column->ascii[ r ] && randf() < 0.03f ) column->ascii[ r ] = (char) rand( ' ', 'z' );
				char ascii = column->ascii[ r ];
				if( !ascii ) continue;
				
				int color = ( 240 * r ) / data->row_count;
				if( column->position > ( limit * 3 ) / 2 ) color = clamp( color - (int)( column->position - ( limit * 3 ) / 2 ) / 2, 0 , 255 );
				if( r == data->row_count - 1 ) color = 255;
				int gw = glyph_width( font, ascii );
				glyph( font, ascii, xofs + c * ( w / data->column_count ) + ( data->glyph_max_width - gw ) / 2, yofs + r * ( font->height - 2 ) 
					+ (int) data->columns[ c ].position, (APP_U8) color, p, w, h );
				}
			}
		}

		
