	void circle( int px, int py, int r, float value, float* buffer, int w, int h )
		{
		if( r == 0 ) return;		
		int x1 = px - r;
		int y1 = py - r;
		int x2 = px + r;
		int y2 = py + r;
		
		if( x1 < 0 ) x1 = 0;
		if( y1 < 0 ) y1 = 0;
		if( x2 >= w ) x2 = w - 1;
		if( y2 >= h ) y2 = h - 1;
		
		for( int y = y1; y <= y2; ++y )
			{
			for( int x = x1; x <= x2; ++x )
				{
				float dx = (float)( px - x );
				float dy = (float)( py - y );
				float d = sqrtf( dx * dx + dy * dy );
				float i = d / r;
				float t = i < 0.0f ? 0.0f : i > 1.0f ? 1.0f : i;
				buffer[ x + y * w ] += ( 1.0f - t ) * value;
				}			
			}
		}
			
			
	void render_gaze( float x, float y, int r, float* buffer, int w, int h )
		{
		for( int i = 0; i < w * h; ++i ) buffer[ i ] *= 0.9f;
		for( int i = 0; i < 14; ++ i )
			circle( (int)( x ), (int)( y ), r - 7 * i, 0.1f, buffer, w, h );	
		}	

